import { FETCH_RENTALS } from '../types';

const initialState = {
  rentals: [],
  currentRental: {},
};

export default (state = initialState, action) => {
  switch (action.type) {
    case FETCH_RENTALS:
      return {
        ...state,
        rentals: action.rentals,
      };
    default:
      return state;
  }
};
